            let attr;
            if (/^\./.test(query)) {
                attr = "className";
                query = query.split(".")[1];
            } else if (/^#/.test(query)) {
                attr = "id";
                query = "^" + query.split("#")[1] + "$";
            } else if (/^:/.test(query)) {
                attr = "name";
                query = "^" + query.split(":")[1] + "$";
            } else {
                attr = "nodeName";
                query = "^" + query + "$";
            }
